import React from 'react';
import IdInsert from './IdInsert';
import PwInsert from './PwInsert';
import NickInsert from './NickInsert';
import PwReInsert from './PwReInsert';
import './JoinTemplate.css';

const LoginTemplate = () => {
    return (
        <div className="wrapper">
            <div className="LoginTemplate">
                <div className="LoginTitle">Todo List<p>계정 만들기</p></div>
                <NickInsert />
                <IdInsert />
                <PwInsert /><PwReInsert />
                <div className="button_area">
                    <button className="join_button">회원가입 </button>
                    <button className="back_button">뒤로가기 </button>
                </div>

            </div>
        </div>
    )
};
export default LoginTemplate;
